import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./Home.css"; // optional for custom tweaks

const Home = () => {
  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-dark">
      <div className="card p-4 text-center" style={{ maxWidth: '500px', width: '100%' }}>
        <h1 className="text-light mb-3">Welcome Back, Citizen</h1>
        <p className="text-secondary mb-4">
          Log in to access your portal, manage complaints, and stay updated on services that matter to you.
        </p>
        <div className="d-grid gap-2">
          <button className="btn btn-secondary">Login</button>
          <button className="btn btn-outline-secondary">Register</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
